//打开文件，需要指定打开的权限
////os.O_CREATE：如果文件不存在，将创建一个新文件。如果文件已经存在，则不会执行任何操作。
//os.O_RDONLY：以只读模式打开文件
//os.O_WRONLY：以只写模式打开文件。
//os.O_RDWR：以读写模式打开文件
//os.O_APPEND：以追加的方式打开文件。
//通过按位或（|）运算符组合在一起
e.g:
logFile, err := os.OpenFile("./log.txt", os.O_CREATE|os.O_WRONLY|os.O_APPEND, 0666)
//在0666中，每个数字代表一个权限位的组合。具体解释如下：
//第一个数字 0：表示这是一个八进制数。
//第二个数字 6：表示文件所有者具有读、写权限（4+2）。
//第三个数字 6：表示文件所属组具有读、写权限（4+2）。
//第四个数字 6：表示其他用户具有读、写权限（4+2）。
